import React from "react";

const LogoM = () => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 102 83"
    width="102"
    height="83"
    className="logoM"
  >
    <defs>
      <image
        width="102"
        height="84"
        id="logoM"
        href="data:image/svg+xml;base64,"
      />
    </defs>
    <use
      id="logotyle-mobile.svg"
      href="#logoM"
      transform="matrix(1,0,0,0.988,0,0)"
    />
  </svg>
);

export default LogoM;
